function openTab(evt, tabName) {
    var i, tabcontent, tabbuttons, tabIndicator;
    tabcontent = document.getElementsByClassName("tab-content");

    for (i = 0; i < tabcontent.length; i++) {
        tabcontent[i].style.display = "none";
    }

    tabbuttons = document.getElementsByClassName("tab-button");

    for (i = 0; i < tabbuttons.length; i++) {
        tabbuttons[i].className = tabbuttons[i].className.replace(" active", "");
    }

    document.getElementById(tabName).style.display = "block";
    evt.currentTarget.className += " active";

    tabIndicator = document.querySelector(".tab-indicator");
    const activeButton = evt.currentTarget;
    const buttonsContainer = document.querySelector(".tab-buttons");
    const buttons = Array.from(buttonsContainer.getElementsByClassName("tab-button"));
    const activeIndex = buttons.indexOf(activeButton);
    tabIndicator.style.left = `${evt.currentTarget.offsetLeft}px`;
    const buttonWidth = evt.currentTarget.offsetWidth;
    tabIndicator.style.width = `${buttonWidth}px`;
}

const apiUrl = 'https://api.openweathermap.org/data/2.5/weather?lat=33.89&lon=35.50&appid=aea6761270f9534d9bf8a1c1cf908d22&units=metric';

const fetchWeatherData = async () => {
    try {
        const response = await fetch(apiUrl);
        const data = await response.json();

        displayWeatherInfo(data);
    } catch (error) {
        console.error('Error fetching weather data:', error);
    }
};

const displayWeatherInfo = (weatherData) => {
    const weatherContainer = document.getElementById('weather-container');

    const {
        name,
        weather,
        main,
        wind
    } = weatherData;

    const iconUrl = `https://openweathermap.org/img/wn/${weather[0].icon}.png`;

    weatherContainer.innerHTML = `
        <div class="weather-widget">
            <h2>${name}</h2>
            <p class="temperature">${Math.round(main.temp)}&deg;C</p>
            <img src="${iconUrl}" alt="Weather Icon" class="weather-icon">
            <p class="weather-description">${weather[0].description}</p>
            <ul class="additional-info">
                <li>Humidity: ${main.humidity}%</li>
                <li>Wind: ${wind.speed} m/s</li>
            </ul>
        </div>
    `;
};

