function populateCurrencyDropdowns() {
    const fromCurrencyDropdown = document.getElementById('fromCurrency');
    const toCurrencyDropdown = document.getElementById('toCurrency');

    for (const currencyCode in exchangeRates) {
        const option = document.createElement('option');
        option.value = currencyCode;
        option.text = currencyCode;
        fromCurrencyDropdown.add(option.cloneNode(true));
        toCurrencyDropdown.add(option);
    }
}

function convertCurrency() {
    const fromCurrency = document.getElementById('fromCurrency').value;
    const toCurrency = document.getElementById('toCurrency').value;
    const amount = parseFloat(document.getElementById('amount').value);

    if (isNaN(amount)) {
        alert('Please enter a valid amount.');
        return;
    }

    const fromRate = exchangeRates[fromCurrency];
    const toRate = exchangeRates[toCurrency];

    if (!fromRate || !toRate) {
        alert('Invalid currency selected.');
        return;
    }

    const result = (amount / fromRate) * toRate;
    document.getElementById('result').innerText = `${amount} ${fromCurrency} is equal to ${result.toFixed(2)} ${toCurrency}`;
    document.getElementById('currencyResultContainer').style.display = "block";

}

