function formatDateTime(dateString) {
    const date = new Date(dateString);
    const year = date.getFullYear();
    const month = (date.getMonth() + 1).toString().padStart(2, '0'); // Month is 0-indexed
    const day = date.getDate().toString().padStart(2, '0');
    const hours = date.getHours().toString().padStart(2, '0');
    const minutes = date.getMinutes().toString().padStart(2, '0');
    const seconds = date.getSeconds().toString().padStart(2, '0');

    return `${year}-${month}-${day} ${hours}:${minutes}:${seconds}`;
}

function filterParkingData() {
    var fromDate = new Date(document.getElementById('fromDate').value);
    var toDate = new Date(document.getElementById('toDate').value);

    var filteredData = parkingData.filter(function(spot) {
        var spotFromDate = new Date(spot.from_datetime);
        var spotToDate = new Date(spot.to_datetime);
        return spot.is_available && spotFromDate >= fromDate && spotToDate <= toDate;
    });

    var resultsContainer = document.getElementById('resultsContainer');

    if (filteredData.length === 0) {
        resultsContainer.innerHTML = "No Results Found."
    } else {
        resultsContainer.innerHTML = '';
        filteredData.forEach(function(spot) {
            var div = document.createElement('div');
            div.innerHTML = 'From: ' + formatDateTime(spot.from_datetime) + '       To: ' + formatDateTime(spot.to_datetime) + '        Price: ' + spot.price;
            resultsContainer.appendChild(div);
        });
    }

    function changeTextWithoutAffectingChildren(element, newText) {
        for (let node of element.childNodes) {
            if (node.nodeType === Node.TEXT_NODE) {
                node.nodeValue = newText;
                break;
            }
        }
    }

    var backButton = document.createElement('button');
    backButton.textContent = 'Back';
    backButton.classList.add('btn', 'btn-primary');
    backButton.style.marginTop = "20px";
    backButton.style.display = "block";
    backButton.onclick = function() {
        changeTextWithoutAffectingChildren(document.getElementById('header-text'), 'Park Search');
        document.getElementById('parkingForm').style.display = 'block';
        document.getElementById('parkingResults').style.display = 'none';
        resultsContainer.innerHTML = '';
    };

    resultsContainer.appendChild(backButton);

    changeTextWithoutAffectingChildren(document.getElementById('header-text'), 'Parking Search Results');
    document.getElementById('parkingResults').style.display = 'block';
    document.getElementById('parkingForm').style.display = 'none';
}

function formatDateTime1(date) {
    var local = new Date(date);
    local.setMinutes(date.getMinutes() - date.getTimezoneOffset());
    return local.toJSON().slice(0, 16);
}

